import React from "react";
import Contributors from "./Contributors";

function TableList({ contributorsList, error }) {
  console.log("there is the contributors in TABLE LIST", contributorsList);
  return (
    <>
      {!contributorsList && (
        <p>Please enter a repository to find it's collaborators</p>
      )}
      {contributorsList && contributorsList.length === 0 && <p>Loading...</p>}
      {contributorsList && contributorsList.length > 0 && (
        <ul>
          {contributorsList.map((user) => (
            <Contributors user={user} key={user.id} />
          ))}
        </ul>
      )}
      {error && <p>Error: {error}</p>}
    </>
  );
}

export default TableList;
